import 'package:flutter_easyloading/flutter_easyloading.dart';import 'package:get/get.dart';import 'index.dart';import 'page/0000.auto.switch.page.dart';void main() async {  WidgetsFlutterBinding.ensureInitialized();  //   // Config  Config();  // LocalStorage Service  final localStorageService =      await Get.putAsync(() => LocalStorageService().init());  // UserData Service  Get.put(UserDataService());  runApp(    GetMaterialApp(      translations: TranslationsX(),      locale: localStorageService.locale,      debugShowCheckedModeBanner: false,      theme: localStorageService.brightnessDark          ? ThemeData.dark()          : ThemeData(              appBarTheme: AppBarTheme(                color: Colors.primaries[localStorageService.primarySwatch],                iconTheme: IconThemeData(                  color: localStorageService.isReverse                      ? Colors.white                      : Colors.black87,                ),                foregroundColor: localStorageService.isReverse                    ? Colors.white                    : Colors.black87,              ),              primaryColor: Colors.primaries[localStorageService.primarySwatch],            ),      home: AutoSwitchPage(),      builder: EasyLoading.init(),    ),  );}